import React, { useEffect, useState } from "react";
import LabelStyle1 from "../components/custom controls/labels/LabelStyle1";
import TextBoxStyle2 from "../components/custom controls/textBox/TextBoxStyle2";
import ButtonStyle1 from "../components/custom controls/buttons/ButtonStyle1";
import ComboBoxStyle1 from "./custom controls/combo box/ComboBoxStyle1";
import GoogleIcon from "../Images/GoogleIcon.png";
import Login_SingUp_bg from "../Images/Login_SingUp_bg.png";

export default function SingUp({ SingInButtonHandled }) {
  const SingUpButtonHandled = () => {
    alert("wsh moooooh!");
  };

  

  const facultyOptions = ['Informatique','Math','Physique'];

  const specialityOptions = ['Isil','Si'];

  const academicYearOptions = ['Licence 1','Licence 2','Licence 3','Master 1','Master 2'];

  const [selectedfaculty, setSelectedfaculty] = useState('');
  const [selectedEducationYear, setEducationYear] = useState('');
  const [selectedSpecialty, setSelectedSpecialty] = useState('');

  const handleSelectfacultyChange = (event) => {
    setSelectedfaculty(event.target.value);
  };
  const handleSelectEducationYearChange = (event) => {
    setEducationYear(event.target.value);
  };
  const handleSelectSpecialtyChange = (event) => {
    setSelectedSpecialty(event.target.value);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSingUpFormData((prevData) => ({
      ...prevData,
      [name]: value
    }));
  };

  const [SingUpFormData, setSingUpFormData] = useState({
    firstName: '',
    lastname: '',
    matricule: '',
    faculty: '',
    EducationYear: '',
    Specialty: '',
    email: '',
    password: '',
    confirmPassword: ''
  });

const [specialityComboBoxDisabled,setSpecialityComboBoxDisabled] = useState(true);

useEffect(
  ()=>{
    if(SingUpFormData.EducationYear === 'Licence 1' || SingUpFormData.EducationYear === 'Licence 2'){
      setSpecialityComboBoxDisabled(true);
      SingUpFormData.Specialty = 'Select one';
    } 
    else setSpecialityComboBoxDisabled(false);
  }
,[SingUpFormData.EducationYear]);

  return (
    <div className="flex flex-col items-center w-full h-full p-6 bg-white rounded-lg shadow-md">
      <LabelStyle1 labelText="Sign Up" labelClassName="text-3xl mb-6 text-blue-600" />
      <form className="flex flex-col w-full">
        <div className="space-y-4">
          <div className="flex space-x-2">
            <div className="flex flex-col">
              <LabelStyle1 labelText="First Name:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='firstname' placeholder="First name" value={SingUpFormData.firstName} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
            <div className="flex flex-col">
              <LabelStyle1 labelText="Last Name:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='lastname' placeholder="Last name" value={SingUpFormData.lastname} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
          </div>

          <div className="flex space-x-1 items-center">
            <LabelStyle1 labelText="Matricule:" labelClassName="text-sm" />
            <TextBoxStyle2 Name='matricule' placeholder="222231354689" value={SingUpFormData.matricule} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
          </div>

          <div className="flex space-x-1 items-center">
            <LabelStyle1 labelText="Faculty:" labelClassName="text-sm" />
            <ComboBoxStyle1 Name="faculty" options={facultyOptions} value={SingUpFormData.faculty} onChange={handleChange} comboBoxClassName="w-full border rounded-md shadow-sm" />
          </div>

          <div className="flex space-x-1 items-center">
            <LabelStyle1 labelText="Academic Year:" labelClassName="text-sm" />
            <ComboBoxStyle1 Name="EducationYear" options={academicYearOptions} value={SingUpFormData.EducationYear} onChange={handleChange} />
            <LabelStyle1 labelText="Speciality:" labelClassName="text-sm" />
            <ComboBoxStyle1 Name="Specialty" options={specialityOptions} value={SingUpFormData.Specialty} onChange={handleChange} disabled={specialityComboBoxDisabled} comboBoxClassName={`${specialityComboBoxDisabled ? 'bg-gray-200 cursor-not-allowed' : 'bg-white'}`}/>
          </div>

          <div className="flex space-x-1">
            <LabelStyle1 labelText="Email:" labelClassName="text-md w-auto" />
            <TextBoxStyle2 Name='email' textBoxtype='email' placeholder="example@gmail.com" value={SingUpFormData.email} onChange={handleChange} textBoxClassName="border rounded-md shadow-sm flex-grow" />
          </div>

          <div className="flex space-x-2">
            <div className="flex flex-col">
              <LabelStyle1 labelText="Password:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='password' type='password' placeholder="Password" value={SingUpFormData.password} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
            <div className="flex flex-col">
              <LabelStyle1 labelText="Confirm Password:" labelClassName="text-sm ml-1" />
              <TextBoxStyle2 Name='confirmPassword' type='password' placeholder="Confirm password" value={SingUpFormData.confirmPassword} onChange={handleChange} textBoxClassName="w-full border rounded-md shadow-sm" />
            </div>
          </div>
        </div>

          <ButtonStyle1 buttonText="Sign Up" buttonClassName="items-center w-full mt-10" onClick={SingUpButtonHandled} />
      </form>

      <p className="text-gray-400 text-xs mt-4">
        Already have an account? 
        <button onClick={SingInButtonHandled} className="text-blue-400 hover:underline"> Sign In</button>
      </p>
    </div>
  );
}
